import numpy as np
import scipy.stats
import matplotlib.pyplot as plt

def graphs_cost_vs_iter(x0, y0, x1, x2, x3, y1, y2, y3, graph_name):
    f = plt.figure(1, figsize=(6, 3))
    plt.ticklabel_format(style='sci', axis='y', scilimits=(0, 0))

    ax = f.add_subplot(111)

    ax.errorbar(x0, y0, color='g', marker='*', label='C-CoCoA')
    ax.errorbar(x1, y1, color='r', linestyle='-.', label='HCMS')
    ax.errorbar(x2, y2, color='b', linestyle='-.', label='PFD1')
    ax.errorbar(x3, y3, color='y', linestyle='-.', label='CDSA')

    ax.set_xlabel('Time (sec)')
    ax.set_ylabel('Solution cost')

    plt.legend(loc='upper right')
    f.savefig(graph_name + ".png", bbox_inches='tight')

    plt.show()

def graphs_time_vs_iter(x1, x2, y1, y2, graph_name):
    f = plt.figure(1, figsize=(6, 3))
    plt.ticklabel_format(style='sci', axis='y', scilimits=(0, 0))
    plt.grid(True)
    ax = f.add_subplot(111)

    ax.errorbar(x1, y1, color='r', linestyle='-.', label='HCMS')
    ax.errorbar(x2, y2, color='b', linestyle='-.', label='PFD1')
    # ax.errorbar(x1, y3, color='g', linestyle='-.', label='PFD2')

    ax.set_xlabel('Iter')
    ax.set_ylabel('Solution cost')

    plt.legend(loc='upper left')
    f.savefig(graph_name + ".png", bbox_inches='tight')

    plt.show()



